/** 
 * If the processor class is annotated with {@link SupportedAnnotationClasses} , return an unmodifiable set with theset of strings corresponding to the array of classes of the annotation. If the class is not so annotated, the {@link AbstractProcessor#getSupportedAnnotationTypes()} method is called.
 * @return the names of the annotation classes supported by this processor,or  {@link AbstractProcessor#getSupportedAnnotationTypes()} resultif none
 */
public Set<String> getSupportedAnnotationTypes(){
  SupportedAnnotationClasses sac=this.getClass().getAnnotation(SupportedAnnotationClasses.class);
  if (sac == null) {
    if (isInitialized())     processingEnv.getMessager().printMessage(Diagnostic.Kind.WARNING,"No " + SupportedAnnotationClasses.class.getSimpleName() + " annotation "+ "found on "+ this.getClass().getName()+ ", returning parent method result.");
    return super.getSupportedAnnotationTypes();
  }
 else   return arrayToSet(sac.value());
}
